import React from 'react';
import "./website.css";
import Navbar from "./Navbar";
import {Routes,Route} from "react-router-dom";
import Gallery from './Gallery';

function Website() {
  return (
    <>
    <Navbar/>
 <Routes>
    
    <Route path="/Gallery" element={<Gallery/>}/>
 </Routes>
  
   </>
  )
}

export default Website;
